import React, { useState } from "react";

const ChatFooter = () => {
  const [message, setMessage] = useState();
  return (
    <div>
      <form className="bg-slate-800 h-[80px]">
        <input
        className="bg-none"
          type="text"
          placeholder="Type message here"
          value={message}
          onChange={(e) => setMessage(e.target.value)}
        />
        <button>Send</button>
      </form>
    </div>
  );
};

export default ChatFooter;
